INSERT INTO `micro-sd-karte` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (5, '../img/products/Micro-SD-Karte/Samsung PRO Plus 128GB microSDXC.webp;', 'Samsung PRO Plus 128GB microSDXC', 'https://www.amazon.de/Samsung-microSDXC-Speicherkarte-SD-Adapter-MB-MD128KA/dp/B09D3NPHLP/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=2C1SYGJZTS01C&keywords=Samsung+PRO+Plus+128GB+microSDXC&qid=1667129264&qu=eyJxc2MiOiIxLjI4IiwicXNhIjoiMC43OSIsInFzcCI6IjAuNDQifQ%3D%3D&sprefix=samsung+pro+plus+1%2Caps%2C85&sr=8-3', '18,99', 4.7, 1898, 0, 'Samsung;0.26 g;Micro SDXC;Samsung;PRO Plus mSD;128 GB;Zuverlässige und robuste Speicherkarte mit hoher Performance für 4K-Videoinhalte auf dem Smartphone oder der Drohne|Hohe Geschwindigkeit: für mehr Videoaufnahmen auf und massenhafte Übertragung mit zuverlässig schnellen Lese-/Schreibgeschwindigkeiten von bis zu 160/120MB/s|Massig Speicher für Ihre Aufnahmen: Wählen Sie zwischen 512 GB, 256 GB, 128 GB Speicherkapazität|Besonders robust dank 6-fach Schutz: Wasserfest, temperaturbeständig, röntgensicher, magnetresistent, sturzsicher &amp; verschleißfrei|SD-Adapter: Der mitgelieferte SD-Adapter macht die PRO Plus mit einer Reihe von verschiedenen Geräten kompatibel.');
INSERT INTO `micro-sd-karte` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (6, '../img/products/Micro-SD-Karte/Netac 128GB MicroSDXC.webp;', 'Netac 128GB MicroSDXC', 'https://www.amazon.de/sspa/click?ie=UTF8&spc=MToxMjc2MzQ0NzQyNzY5MDcxOjE2NjcxMjkyNzA6c3BfYXRmOjIwMDQyMTk1MjE2MjA0OjowOjo&sp_csd=d2lkZ2V0TmFtZT1zcF9hdGY&url=%2FGigastone-MicroSD-UHS-I-Class-Speicherkarte%2Fdp%2FB07LBSBX5L%2Fref%3Dsr_1_1_sspa%3F__mk_de_DE%3D%25C3%2585M%25C3%2585%25C5%25BD%25C3%2595%25C3%2591%26crid%3DUI014VT9BP2Q%26keywords%3DNetac%2B128GB%2BMicroSDXC%26qid%3D1667129270%26sprefix%3D%252Caps%252C75%26sr%3D8-1-spons%26psc%3D1', '24,99', 4.7, 6898, 0, 'Gigastone;9 g;Micro SDXC;Gigastone;-;128 GB;[Geschwindigkeit] : Lese- und Schreibgeschwindigkeit von bis zu 100/50 MB/s, V30-Geschwindigkeitsgrad, Ultra HD (UHD) 4K-Videoaufnahme, UHD 4K-Gaming.|[App] : A1-Grade bietet eine schnellere App-Ladeleistung für Smartphone &amp; Tablet.|[Speicher] : Erweitert den internen Speicherplatz des Smartphones. Ermöglicht die Verschiebung/Herunterladung der Apps auf Micro SD-Karte.|[Kompatibilität] : Speichererweiterung für Laptops, Tablets, PCs, Smartphones, Kameras, DSLR, Dashcams, Camcorder, Überwachungskameras, e-Reader, Drohne, Gaming, Dateien, Videos, Musik. Kompatibel mit Nintendo Switch GoPro Android Samsung Canon Nikon.|[Unterstützung] : Gigastone 5 Jahre beschränkte Garantie einschließlich kostenloser Datenwiederherstellung.');
INSERT INTO `micro-sd-karte` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (7, '../img/products/Micro-SD-Karte/Amazon Basics  microSDXC 128 GB.webp;', 'Amazon Basics  microSDXC 128 GB', 'https://www.amazon.de/Amazon-Basics-microSDXC-Memory-Adapter/dp/B08TJRVWV1/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=3MYB6NHVM4K5F&keywords=Amazon+Basics+microSDXC+128+GB&qid=1667129276&sprefix=%2Caps%2C94&sr=8-3', '15,99', 4.6, 18334, 0, 'Amazon Basics;0.27 g;-;Micro SDXC;Amazon;-;128 GB;BREITE KOMPATIBILITÄT: Kompatibel mit Smartphones, Tablets, Kameras, GoPro-/Action-Kameras, Laptops, Desktop-Computern, Spiegelreflexkameras, Drohnen, Nintendo Switch/anderen tragbaren Konsolen und vielem mehr. Mit SD-Adapter|HOCHWERTIGES SPEICHERN: Perfekt für hochauflösende Fotos, zur Aufnahme und zum Speichern von Full HD-/4K-Videos und allen anderen Dateiformaten|ULTRA-SCHNELL: Lesegeschwindigkeit von bis zu 100 Mbit/s. Schreibgeschwindigkeit von bis zu 60 Mbit/s (variiert je nach Speichergröße). Geschwindigkeitsklassen UHS, U3, Klasse 10 und A2 für ein optimales Smartphone-Erlebnis|DAUERHAFTE ZUVERLÄSSIGKEIT: Stoßfest, IPX6-wasserfest, temperaturbeständig (-10° bis 80°&nbsp;C), Röntgenstrahlen- und magnetsicher|Die tatsächliche Speicherkapazität, die vom Betriebssystem Ihres Geräts angezeigt wird, kann aufgrund unterschiedlicher Messstandards geringer sein als die Kapazität, die auf dem Produktetikett angegeben ist.|Die Lese- und Schreibgeschwindigkeiten basieren auf internen Tests, die unter kontrollierten Bedingungen durchgeführt wurden. Die tatsächlichen Geschwindigkeiten können je nach genutztem Gerät, Schnittstelle, Nutzungsbedingungen und anderen Faktoren variieren|Überprüfen Sie, ob Ihr Gerät mit der Kapazität der MicroSD-Karte kompatibel ist. Sollte das Gerät beispielsweise nur eine maximale Kapazität von 64&nbsp;GB unterstützen, erkennt es MicroSD-Karten mit 128&nbsp;GB oder mehr eventuell nicht|Wenn Sie eine Produktversion ohne das A2-Logo erhalten, ist die Leistung immer noch auf A2-Niveau. Wir ändern den Druck und die Verpackung des Produkts, um das A2-Logo aufzunehmen');
