INSERT INTO `micro-sd-karte` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (12, '../img/products/Micro-SD-Karte/ARCANITE 64 GB microSDXC-Speicherkarte.webp;', 'ARCANITE 64 GB microSDXC-Speicherkarte', 'https://www.amazon.de/ARCANITE-Microsdxc-Speicherkarte-inkl-Adapter/dp/B07RW7RSVQ/ref=sr_1_3?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=SFLXTPII4O6L&keywords=ARCANITE+64+GB+microSDXC-Speicherkarte&qid=1667129312&qu=eyJxc2MiOiIwLjAwIiwicXNhIjoiMC4wMCIsInFzcCI6IjAuMDAifQ%3D%3D&sprefix=arcanite+64%2Caps%2C92&sr=8-3', '18,17', 4.6, 23907, 0, 'ARCANITE;10 g;Nein;Micro SD;ARCANITE;AKV30A164;64 GB;MicroSDXC Speicherkarte mit SD-Adapter. UHS-I U3, A1, V30, 4K Ultra HD, Klasse 10. Für Kameras, Tablets, Smartphones und andere Geräte|In Taiwan hergestellt. Wasserfest, stoßfest, röntgensicher und klimabeständig|Lesegeschwindigkeit bis zu 90 MB/s. Schreibgeschwindigkeit bis zu 45 MB/s. Tatsächliche Transfergeschwindigkeit ist von der Betriebsumgebung, der Computerausstattung und weiteren Faktoren abhängig|Perfekt zum Aufbewahren von Dokumenten, Bildern und Videos geeignet|Kompatibel mit allen Geräten, die microSDXC-Karten unterstützen. 2 Jahre Herstellergarantie');
INSERT INTO `micro-sd-karte` (ranking, picture, name, main_url, main_price, star, review_count, highlight,detail) VALUES (13, '../img/products/Micro-SD-Karte/Verbatim Premium U1.webp;', 'Verbatim Premium U1', 'https://www.amazon.de/Verbatim-43962-SecureDigital-Class-SDHC-Karte/dp/B0050OFBWI/ref=sr_1_2?__mk_de_DE=%C3%85M%C3%85%C5%BD%C3%95%C3%91&crid=1JOZ3QW2I334T&keywords=Verbatim+Premium+U1&qid=1667129327&sprefix=%2Caps%2C88&sr=8-2', '7,99', 4.5, 991, 0, 'Verbatim;-;-;SDHC;-;-;-;16 GB;OPTIMALE AUFLÖSUNG: Die Speicherkarte überzeugt dank Leistungsklasse 10 mit einer Datenübertragsrate von mind. 80 Mbit/s - sie ermöglicht es Ihnen, Full-HD-Videos aufzunehmen.|SCHNELLE ÜBERTRAGUNG: Mit der SD-Karte profitieren Sie von sehr kurzen Übertragungszeiten Ihrer Dateien - dank einer Lesegeschwindigkeit von bis zu 80 MB/s &amp; Schreibgeschwindigkeit von mind. 10 MB/s.|VIELSEITIGE EINSATZGEBIETE: Die SDHC-Speicherkarte ist mit jedem elektronischen Gerät bspw. PC &amp; Kamera kompatibel, dass einen Einschub für die SDHC/SDXC-Speicherkarte besitzt.|PRODUKTDETAILS: Die Speicherkarte von Verbatim ist in den Ausführungen 16 GB , 32 GB , 64 GB, 128 GB und 256 GB erhältlich - sie ist kompatibel mit Kameras &amp; Hostgeräten, die SDXC unterstützen.|Verbatim: Mit unserer jahrelangen Erfahrung stehen wir für genaue &amp; fehlerfreie Datenspeicherung - Unsere Stärken in den Bereichen F&amp;E und Qualitätssicherung garantieren erstklassige Produkte!');
